import React from 'react';
import Button from '../../UserInterface/Buttons/Button/Button'
import Input from '../../UserInterface/Input/Input'
import Textarea from '../../UserInterface/Input/Textarea'
import WindowButtonsConsole from '../../UserInterface/Buttons/WindowButtonsConsole'

function EditWindow (props){
    
    return(

        <div className="">
        
            <Button
                    name = "x"
                    onclick = {props.onclick2}
                    classname = {props.classButtonX}
                    title = "Закрыть окно"
                    type = "button"
                    tabindex = "-1"
                    
                />
        
            <div>
                <h4>{props.nameWindow}</h4>
            </div>
        
            <form>
                <Input 
                        id = {props.id1}
                        label = {props.label1}
                        type = {props.type1}
                        placeholder = {props.placeholder1}
                        value = {props.value1}
                        onchange = {props.onchange1}
                        tabindex = {props.tabIndex1}
                        classNameLabel = {props.classNameLabel}
                        classNameInput = {props.classNameInput}
                        autofocus
                    />
                <Input 
                        id = {props.id2}
                        label = {props.label2}
                        type = {props.type2}
                        placeholder = {props.placeholder2}
                        value = {props.value2}
                        onchange = {props.onchange2}
                        tabindex = {props.tabIndex2}
                        classNameLabel = {props.classNameLabel}
                        classNameInput = {props.classNameInput}
                    />
                <Textarea 
                        id = {props.id3}
                        label = {props.label3}
                        cols = {props.cols}
                        rows = {props.rows}
                        placeholder = {props.placeholder3}
                        value = {props.value3}
                        onchange = {props.onchange3}
                        tabindex = {props.tabIndex3}
                        classNameLabel = {props.classNameLabel}
                        classNameTextarea = {props.classNameTextarea}
                    />
                <Input 
                        id = {props.id4}
                        label = {props.label4}
                        type = {props.type4}
                        placeholder = {props.placeholder4}
                        value = {props.value4}
                        onchange = {props.onchange4}
                        tabindex = {props.tabIndex4}
                        classNameLabel = {props.classNameLabel}
                        classNameInput = {props.classNameInput}
                    />
                <Input 
                        id = {props.id5}
                        label = {props.label5}
                        type = {props.type5}
                        placeholder = {props.placeholder5}
                        value = {props.value5}
                        onchange = {props.onchange5}
                        tabindex = {props.tabIndex5}
                        classNameLabel = {props.classNameLabel}
                        classNameInput = {props.classNameInput}
                    />
                
            </form>
        
            <WindowButtonsConsole
                    name1 = {props.nameButtonSave}
                    onclick1 = {props.onclick1}
                    name2 = {props.nameButtonClose}
                    onclick2 = {props.onclick2}
                    classWrapper = {props.classWrapper}
                    classButtonWrapper = {props.classButtonWrapper}
                    classButton = {props.classButton}
                />

        </div>

    )
}

export default EditWindow
